import React, { Component } from "react";
import axios from "axios";
import {
  Container,
  Label,
  Input,
  FormGroup,
  Form,
  Button,
  Table
} from "reactstrap";
import { Link } from "react-router-dom";

class Users extends Component {
  constructor() {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <h2>Users</h2>
      </div>
    );
  }
}

export default Users;
